import React from "react";
import SignIn from "../../components/sign-in/sign-in.components";

const SignInAndSignUpPage = () => {
  return (
    <div className="sing-in-and-sign-up">
      <SignIn />
    </div>
  );
};

export default SignInAndSignUpPage;
